import React, { useEffect, useState } from "react";
import "./App.css";
import ReactPlayer from "react-player";

function App() {

  const etUses = [
    "Product", 
    "Customer Service", 
    "Systems", 
    "Time Management", 
    "Team Management", 
    "Marketing",
    "Finances",
    "Leadership",
    "Forecasting",
    "Visions"
  ]

  const [companyMatra, setCompanyMatra] = useState("")

  let currentTimeout = 0

  let currentEt = ""

  let count = 0

  let lastDigitNum = 0

  useEffect(()=> {
    lastDigitNum = count
    currentEt = etUses[lastDigitNum]
    count++
    setCurrentTimeout(currentTimeout + 3000)
  }, [])

  useEffect(()=> {
    setTimeout(() => {
      if (count > 9) {
        let numString = count.toString()
        let lastDigitString = numString[-1]
        lastDigitNum = parseInt(lastDigitString)
      } else {
        lastDigitNum = count
      }
      currentEt = etUses[lastDigitNum]
      count++
      currentTimeout = currentTimeout + 3000
      setCompanyMatra(`E x T = ${currentEt}`)
    }, currentTimeout)
  }, [companyMatra])

  useEffect(()=> {
  }, [currentTimeout])

  console.log(companyMatra)

  return (
    <div id="App">
      <div id="TopSection">
        <h1 id="CompanyName">Company</h1>
        <h2 id="CompanyMatra">{companyMatra}</h2>
     </div>
     <div id="MiddleSection">
       <div id="VideoContainer">
        <ReactPlayer 
          url="https://vimeo.com/514419233"
          controls="true"
          playsinline="true"
        />
      </div>
     </div>
     <div id="BottomSection">
        <h3 id="CompanyType">Company LLC</h3>
        <h3 id="CompanyEmail">hi@company.com</h3>
     </div>
    </div>
  );
}

export default App;
